import '../styles/projects.css';

function ProjectCard({ titulo, descripcion, imagen, tecnologias, code, live }) {
  return (
    <div className="project-card">
      <div className="card-image">
        <img src={imagen} alt={titulo} />
      </div>
      <div className="card-info">
        <h2>{titulo}</h2>
        <p>{descripcion}</p>
        <div className="tech-icons">
          {tecnologias.map((icon, i) => (
            <img key={i} src={icon} alt="tech-icon" className="tech-icon" />
          ))}
        </div>
        <div className="card-buttons">
          {code && <a href={code} target="_blank" rel="noreferrer" className="btn">Code</a>}
          {live && <a href={live} target="_blank" rel="noreferrer" className="btn btn-live">Live</a>}
        </div>
      </div>
    </div>
  );
}

export default ProjectCard;
